package com.obpoo.gfsfabricsoftware.TransferStock.DataModel.TransferStock;import android.os.Parcel;import android.os.Parcelable;import com.google.gson.annotations.Expose;import com.google.gson.annotations.SerializedName;import java.util.ArrayList;public class DocumentData implements Parcelable {    @SerializedName("status")    @Expose    private String status;    @SerializedName("message")    @Expose    private String message;    @SerializedName("data")    @Expose    private ArrayList<DocDataDetails> data = null;    protected DocumentData(Parcel in) {        status = in.readString();        message = in.readString();    }    public static final Creator<DocumentData> CREATOR = new Creator<DocumentData>() {        @Override        public DocumentData createFromParcel(Parcel in) {            return new DocumentData(in);        }        @Override        public DocumentData[] newArray(int size) {            return new DocumentData[size];        }    };    public String getStatus() {        return status;    }    public void setStatus(String status) {        this.status = status;    }    public String getMessage() {        return message;    }    public void setMessage(String message) {        this.message = message;    }    public ArrayList<DocDataDetails> getData() {        return data;    }    public void setData(ArrayList<DocDataDetails> data) {        this.data = data;    }    @Override    public int describeContents() {        return 0;    }    @Override    public void writeToParcel(Parcel dest, int flags) {        dest.writeString(status);        dest.writeString(message);    }}